import Card from "./components/card";
import { trekData } from "./trekInfo";
import Temp from "./components/temp";

function App() {
  return (
    <div className="relative flex items-center">
      <div className="w-full h-full overflow-x-scroll scroll whitespace-pre scroll-smooth scrollbar-hide">
        {trekData.map((item) => (
          <Temp key={item.id} data={item} />
        ))}
      </div>
    </div>
  );
}

export default App;
